  `color` varchar(7) DEFAULT '#3b82f6' COMMENT 'Event color in hex format',
  `reminder_minutes` int DEFAULT NULL COMMENT 'Minutes before event to send reminder',
  `recurring` tinyint(1) NOT NULL DEFAULT '0',
